import * as ActionTypes from "../Types";
import { postData } from "../services";

const oncreateDietician = (payload) => {
  if(payload.code) {
    return {
      type: ActionTypes.CREATE_DIETICIAN_FAIL,
      payload
    }
  } else {
    return {
      type: ActionTypes.CREATE_DIETICIAN_SUCCESS,
      payload
    }
  }
};

export const createDietician = (url, payload) => {
  return postData(url, payload, oncreateDietician);
}

export const createDieticianStateToDefault = () => {
  return {
    type: ActionTypes.CREATE_DIETICIAN_DEFAULT,
  }
}
